script: |
  super -f text -I q11195.spq | sort > q11195.out

inputs:
  - name: q11195.spq
    data: |
      SELECT DISTINCT tab1.col2 + col0 + + col1 AS col0 FROM tab1 (FORMAT parquet) WHERE - col1 NOT IN ( col1 * col2 );
  - name: tab1

outputs:
  - name: q11195.out
    data: |
      131
      189
      83
